// src/components/Menu.js
import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

const MenuContainer = styled.div`
  display: flex;
  gap: 10px;
  margin-bottom: 20px;
`;

const MenuItem = styled(Link)`
  text-decoration: none;
  color: #333;
  padding: 10px;
  background-color: #f1f1f1;
  border-radius: 5px;
  &:hover {
    background-color: #ddd;
  }
`;

const Menu = () => {
  return (
    <MenuContainer>
      <MenuItem to="/autores">Autores</MenuItem>
      <MenuItem to="/livros">Livros</MenuItem>
      <MenuItem to="/user">Autores</MenuItem>
    </MenuContainer>
  );
};

export default Menu;
